INSERT INTO `guildies` (`id`, `ringID`, `firstname`, `lastname`, `year`, `bio`, `photo`, `from`, `email`, `active`, `college`, `major`, `netid`, `office`, `phone`, `heeladmin`, `guildieadmin`, `newsadmin`, `inGuild`, `birthday`)
VALUES
	(1,0,'Stephen','Hall',2014,'Stephen is a Junior in Jonathan Edwards College who loves everything Carillon and Engineering. He\'s a Mech-E major who\'s always tinkering around with projects in the lab. In his \"free time\" (outside problem sets, lab work, and the Carillon of course), he enjoys chatting with friends, watching movies, Eggplant Parmesan, chocolate chip cookies, and anything Apple related.','stephen.jpg','Providence, RI','stephen.hall@yale.edu',1,'Jonathan Edwards','Mechanical Engineering','sdh33','Webmaster and Recording Engineer','401-864-9488',1,1,1,1,'10-13-1991'),
	(2,0,'Elena','Perry',2014,'Elena is a biology major. Her favorite foods include strawberries and pocky. She also loves to climb towers (possibly because she is vertically challenged). When she\'s not studying or doing something music-related, she enjoys following the sport of horse racing, doing jigsaw puzzles, and indulging her addiction to Korean dramas.','elena.jpg','','elena.perry@yale.edu',1,'Branford','Biology','','Newsletter','',NULL,NULL,NULL,1,''),
	(3,0,'Sophia','Jia',2014,'Sophia is fresh off the boat. Not really. But she is from a million places. If this Morse freshman could rewrite the history books, she would tell history only through love stories. She is arguably the slowest carillon stair climber (both up and down). When not playing the carillon or the pots and pans in the YPMB or reading hundreds of pages of epics or ballroom dancing, Sophia is eating. Or sleeping. Or committing planticide. Or buying more shoes (it\'s a problem, undiagnosed).','sophia.jpg','Hong Kong','sophia.jia@yale.edu',1,'Morse','','','Tour Manager, Social Chair','',NULL,NULL,NULL,1,''),
	(4,0,'Lynnli','Wang',2015,'Lynnli has commitment issues, and thus has no prospective major as of yet. She loves watching Ellen Degeneres on Youtube and listening to classical music in her spare time, if and when it exists. If she\'s not busy bothering friends, laughing, hugging people, or ballroom dancing, she can be found at the top of Harkness Tower, serenading all Yalies. Private concerts on piano and violin also available upon request.','lynnli.jpg','New Jersey','lynnli.wang@yale.edu',1,'Timothy Dwight','','','Heeler Monster, Social Chair','',NULL,NULL,NULL,1,''),
	(10,1,'Ellen','Dickinson',2012,'Ellen \'97, \'99 MUS, has previously been a member of the Board of Directors of the Guild of Carillonneurs in North America. She joined the Yale Guild in her sophomore year, and served as co-chair in her junior and senior years. She now serves as the Guild\'s advisor, and has two children, ages one and three.','ellen.png','Stamford, CT','xmcvnvxc@yale.edu',1,'','Music','','','1234567',NULL,NULL,NULL,1,NULL),
	(11,0,'Maggie','Bennewitz',2013,'After not playing an instrument in undergrad, Maggie realized just how much she missed music. Being part of the Guild has made a huge impact on her time spent here because it brought music back into her life, while giving her the opportunity to make new friends and wonderful memories while at Yale and on tour. If you listen to one of her rings, you can look forward to hearing some familiar tunes!','maggie.jpg','Easton, PA',NULL,0,'Graduate Student','','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(12,0,'Graham','Radman',2009,'Graham is a senior majoring in Computer Science and Psychology. He hails from the great state of Texas, where he went to the St. Mark’s School of Texas in Dallas. In addition to being in his fourth year with the Guild of Carillonneurs, Graham also serves Captain of the Yale Men’s Polo Team. He will be working next year as a financial consultant in New York.','graham.jpg','Dallas, TX',NULL,0,'Pierson','','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(13,0,'Chris','Lambie-Hanson',2009,'Chris is majoring in Mathematics. His interests include playing the carillon, spiral staircases, and juggling with the Yale Anti-gravity Society.','chris.jpg','Indianapolis, IN',NULL,0,'Morse','Mathematics','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(14,0,'Ja-mei','Or',2009,'Ja-mei is a senior Political Science major from Amarillo, Texas. In addition to the Guild, she is also involved in SSDP, the Bandits, and music ensemble. Ja-Mei wants to make a shoutout to her family and friends.','jamei.jpg','Amarillo, TX',NULL,0,'Berkeley','','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(15,0,'Carrie','Smith',2009,'Carrie is a senior English major in Saybrook College and has been with the Guild since freshman year. Her favorite things to play on the carillon are mid-90\'s R&B and anything by Ronald Barnes.','carrie.jpg','Shaker Heights, OH',NULL,0,'Saybrook','English','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(16,0,'Casey','Klippel',2009,'Casey is a senior in Trumbull College. In addition to being historian and recording engineer for the Guild, she is also president of the Yale Glee Club. She enjoys singing, eating stroopwafels, reading, taking pictures of stroopwafels, trying to pick up new languages, rapping about stroopwafels, wearing her Harkness Hat, and random happenings that involve fun, hilarity, adventure, stroopwafels.','casey.jpg','Avon, CT',NULL,0,'Timothy Dwight','','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(17,4,'Andrew','Wetzel',0,'Upon discovering that the Universe is a really interesting place, Andrew decided to spend his life studying it, first earning a B.S. in physics from Harvey Mudd College, then a Ph.D. in astrophysics from U.C. Berkeley, and now working as a postdoctoral research associate in the Astronomy Department at Yale. He began playing carillon at U.C. Berkeley, where he studied with Jeff Davis, and in 2010 he passed his advancement exam to become a Carillonneur Member of the Guild of Carillonneurs in North America.','andrew_w.jpg','','',1,'Post Doc','','','','',NULL,NULL,NULL,1,''),
	(18,0,'Jin Su','Joo',2010,'Jin Su grew up in Seoul, Korea and attended high school in Massachusetts and Zaragoza, Spain. She enjoys traveling, making cocktails, coffee, modern art and big cities.','jinsu.jpg','Seoul, South Korea',NULL,0,'Trumbull','','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(19,0,'Kate','Kraft',2010,'Kate is a History major. Born in South Africa, she is also an active member of the Yale Precision Marching Band and a photographer for the Yale Daily News.','kate.jpg','La Canada Flintridge, CA',NULL,0,'Siliman','History','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(20,0,'Amy','Yuan',2010,'Amy is a Biomedical Engineering major. She enjoys climbing spiral staircases and playing Stefano Coletti\'s Sonatine.','amy.jpg','Sydney, Australia',NULL,0,'Siliman','Biomedical Engineering','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(21,0,'Liza','Van Gundy',2010,'Liza is a Political Science major. Outside of the Guild, she plays the viola with the Berkeley College Orchestra.','liza.jpg','Scarsdale, NY',NULL,0,'Berkeley','Political Science','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(22,0,'Ming-Yee','Lin',2013,'Ming-yee is a Law School student, and before that, an East Asian Studies major. She enjoys climbing spiral staircases and spent her junior year fall semester in Peking University.','mingyee.jpg','Lilburn, GA',NULL,0,'Law','','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(23,0,'Joey','Brink',2011,'Joey is a Mechanical Engineering major. He joined the guild his freshman year and has been loving it ever since!','joey.jpg','Madison, CT','',1,'Calhoun','Mechanical Engineering','','',NULL,NULL,NULL,NULL,1,NULL),
	(24,0,'Clarence','Chenge',2011,'Clarence walks quickly, takes stairs by twos, rollerblades, researches proteins, organizes objects, and plays carillon, among other activities. His main interests are science and music, though he also enjoys literature, the company of friends, and being helpful. He says \'bag\' correctly, as they do in Minnesota, and occasionally refers to soda as pop.','clarence.jpg','St. Cloud, MN',NULL,0,'Ezra Styles','','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(25,0,'Nick','Huang',2011,'Nick never realized he would be climbing so many spiral staircases when he flew here from Singapore. Outside of Harkness Tower, he is also a fan of Indonesian gamelan music.','nick.jpg','Singapore',NULL,0,'Timothy Dwight','','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(26,0,'Lynn','Wang',2011,'Although she is from California, Lynn has lived in Urumqi, China, and Sydney, Australia. She also really likes lamb, cooked in all forms.','lynn.jpg','Cerritos, CA',NULL,0,'Timothy Dwight','','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(27,0,'River','Kim',2011,'River is from Kailua, Hawaii and enjoys spending time with friends and family at the beach. Some of his other hobbies include playing football and traditional Hawaiian music. He\'s a prospective history major at Yale and is fascinated by snow and squirrels.','river.jpg','Kailua, HI',NULL,0,'Saybrook','','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(28,0,'Emily','Cooley',2012,'Emily is a music major. She loves the Midwest, sushi, Gustav Mahler, crossword puzzles, and the Guild (of course).','emily_c.jpg','Mequon, Wi',NULL,0,'Pierson','Music','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(29,0,'Jessica','Hsieh',2012,'Jessica\'s greatest joys include linguistics, the internet, and obscure instruments that she has to explain to people. She wishes she didn\'t like spiral staircases, but she secretly does.','jessica.jpg','Simsbury, CT','',0,'Jonathan Edwards','Linguistics','jth5','','',NULL,NULL,NULL,1,''),
	(30,0,'Vera','Wuensche',2012,'Vera was born in East Berlin in 1989. As an infant, she orchestrated the fall of the Berlin Wall, but then settled down to enjoy the simpler things in life, such as making jam. At Yale, she is a MCDB major with a concentration in the evolutionary mating techniques as displayed at Toad\'s.','vera.jpg','Eichwalde, Germany','',0,'Jonathan Edwards','MCDB','','','',NULL,NULL,NULL,1,''),
	(31,0,'Bianca','Yuh',2012,'Bianca is a Biology major in Ezra Stiles College. She loves anything with Nutella, Zambian music, trashy TV shows, and afternoon naps. On the rare occasions that Bianca emerges from the Stiles tower, you can find her trekking up Science Hill, scavenging for free food, or stalking actors from the Vampire Diaries (count: 2).','bianca.jpg','New Milford, CT','',0,'Ezra Styles','Biology','','',NULL,NULL,NULL,NULL,1,NULL),
	(32,0,'Julie','Zhu',2012,'Julie is wrestling with the history of modern art in immediate, social, and experiential terms, inspired by the spatial, temporal, and situational perception of reality, and the fluid relationship between society and identity and subjectivity. Yes, she is a pretentious bitch. But other than that, she is a volleyball player, tea drinker, cartoonist, enthusiastic traveler, human, and furious lover/artist. Won’t you give her a hug?','julie.jpg','North Potomac, MD',NULL,0,'Morse','Art and Math','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(33,0,'Darren','Zhu',2013,'Darren hails from good ol\' North Carolina where he attended both a conservatory and a science?mathematics school (mascots of said schools were a pickle and a unicorn, respectively). Equipped with chemistry bumper stickers and a magnetic periodic table on his fridge, Darren was once confident in his plans to major in chemistry; now, he is not so sure (unfortunately, he is not sure why he is unsure). When he has nothing better to do, Darren enjoys climbing trees, studying études, and watching coll','darren.jpg','Winston-Salem, NC',NULL,0,'Branford','','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(34,0,'Kevin','Zheng',2012,'Kevin is double-majoring in Mathematics and Statistics, with a concentration in numbers. When he isn\'t trudging through endless problem sets, he spends his free time sleeping, eating, engaging in intense games of Bananagrams, and watching TV (like a boss). He also thinks it would be very exciting to be involved in a car chase scene in a parking garage similar to the one in The Pelican Brief.','kevin.jpg','Lee\'s Summit, MO',NULL,0,'Siliman','Mathmatics and Statistics','kz5',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(35,0,'Tiffany','Lin',2013,'Tiffany is an Economics and Mathematics major in Pierson College. Some of her favorite things (besides big bells) include roller coasters, nutella, chamber music and snow.','tiffany.jpg','Cerritos, CA','tiffany.lin@yale.edu',1,'Pierson','Economics and Mathmatics','','Co-chair','',NULL,NULL,NULL,1,''),
	(36,0,'Wendy','Hou',2012,'Wendy is insane:\nA demon in demons\' garb.\nPeace, love, happiness.','wendy.jpg','Seffner, FL',NULL,0,'Davenport','Computer Science','wh42',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(37,0,'Sam','Martin',2014,'Sam Martin is so happy to be in the Guild of Carillonneurs; it made his semester. He is a freshman in Morse College and wants to major in some type of engineering, in part because he\'s one of those people who enjoys doing problem sets. We\'ll see if he still thinks that next year, of course. He also enjoys writing, composing, playing piano, acting, and most of all spending time with friends.','sam.jpg','Berkeley, CA',NULL,0,'Morse','Mechanical Engineering','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(38,0,'Michael','Alpert',2013,'Mike is currently in his second year at the Yale School of Medicine. After graduating from Yale with a BA in Chinese, he moved to Kunming, China, where he worked at an NGO and taught English at a coffee shop. He played piano and French horn as an undergrad, and he\'s thrilled that he now rings the loudest instrument on campus every week. His hobbies include: playing bluegrass, barefoot running, throwing frisbees, and food blogging.','mike_a.jpg','',NULL,1,'Graduate Student','','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(39,0,'Emily','Monjaraz',2014,'Emily is a sophomore in Saybrook. She loves going to Disneyland and sleeping on top of kind people in Dutch train stations. (P.S. Thanks Kerri!)','emily_m.jpg','Glendora, CA','emily.monjarez@yale.edu',1,'Saybrook','','','Publicity Chair',NULL,NULL,NULL,NULL,1,NULL),
	(40,0,'Kerri','Lu',2014,'Kerri is a freshman in Pierson College. She loves to watch people eat and is often found laughing. As undecided as they come, she is as excited for the present as she is for the future, where she will major in something wonderful and hopefully stop talking in third person.','kerri.jpg','Richmond, British Columbia','',1,'Pierson','','kkl5','Social Chair, Historian','',NULL,NULL,NULL,1,''),
	(41,0,'Michael','Solotke',2013,'Michael is an MB&B major in Davenport College (2013). Originally from Chicago\'s North Shore, he also plays the trombone in the YSO and the piano. Outside of his love for Harkness Tower (his fiercest love), he enjoys sketchy late night walks, general ridiculousness, and buttons.','michael_s.jpg','Chicago, IL','michael.solotke@yale.edu',1,'Davenport','MB&B','mts3','Tower Keeper',NULL,NULL,NULL,NULL,1,NULL),
	(42,0,'Mika','Sumida',2013,'Mika is a math major in Branford. Apart from ringing the bells, she enjoys playing saxophone for the YCB, hanging out at coffee shops, and thinking about logic puzzles.','mika.jpg','Woodcliff Lake, NJ',NULL,1,'Branford','Math','',NULL,NULL,NULL,NULL,NULL,1,NULL),
	(43,0,'Bryan','Yang',2014,'Bryan is a math major in Morse College with many psets due/week. He loves curly fries, sushi, and ramen. He enjoys watching tv series, browsing reddit, reading science fiction, and watching poker. He hopes to try his luck at las vegas someday, even though he\'ll probably lose money.','bryan.jpg','Cupertino, CA','bryan.yang@yale.edu',1,'Morse','Math','','Treasurer',NULL,NULL,NULL,NULL,1,NULL),
	(44,0,'Brendan','Lim',2015,'Brendan comes to New Haven from Australia as a JSD Candidate at the Law School. His undergraduate studies were in mathematics and music, the latter being undertaken in jazz piano at the Elder Conservatorium. Brendan performed regularly in Australia in both solo and ensemble settings, drawing on standard and contemporary repertoire as well as original compositions. He is excited by his latest foray into carillon performance.','brendan.jpg','Australia','brendan.lim@yale.edu',1,'Law','','','',NULL,NULL,NULL,NULL,1,NULL),
	(45,0,'Joel','Li',2015,'Joel is from Malmö, Sweden. It is beside Copenhagen and they do not have the Alps. He is a prospective environmental engineering major with a passion to influence sustainability. His two main interests are music and football which he loves doing during his free time. His favorite team is Tottenham Hotspur because of their coach, Harry. Random: He does not eat birds because he wanted to be a vegetarian but couldnâ€™t, so birds became the animal he stays away from','joel.jpg','Malmo, Sweeden','joel.li@yale.edu',1,'Branford','Environmental Engineering','','Tower Keeper',NULL,NULL,NULL,NULL,1,NULL),
	(46,0,'Rachel','Perfecto',2015,'Rachel is a prospective music major. She loves playing oboe and large bronze instruments. She is happiest when she arrives at an intersection on her walk to lunch (her favorite meal) and hears the sound signifying that she can diagonal cross just as reaches this point. Unfortunately, this rarely happens.','rachel.jpg','Poughkeepsie, NY','rachel.perfecto@yale.edu',1,'Saybrook','Music','','Librarian, Historian','',NULL,NULL,NULL,1,''),
	(47,0,'Katie','Leiby',2014,'Katie is a biomedical engineering major. In her free time, she enjoys running, cooking, and knitting. She regrets that two of her favorite things, peanut butter and anything French, are mutually exclusive.','katie.jpg','Wyomissing, PA','katherine.leiby@yale.edu',1,'Siliman','Biomedical Engineering','kll36','Co-chair','',NULL,NULL,NULL,1,''),
	(48,0,'Katherine','Zhou',2012,'Katherine Zhou is majoring in MB&B and would like to study medicine and biochemistry after college. Her other interests include music, foreign languages, and long-distance running.','katherine.jpg','Chicago, IL','',0,'Saybrook','MB&B','','','',NULL,NULL,NULL,1,'');
